import './App.css';
import 'bootstrap/dist/css/bootstrap.css';


function App() {
  return (
    <div className="lista-contactos text-center">
      <h1 className="">Lista Contactos</h1>
      <table className=''>
          <thead>
            <tr>
              <th>Nombre</th>
              <th>apellido</th>
              <th>status</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>carmen</td>
              <td>lopez</td>
              <td>conectada</td>
            </tr>

          </tbody>
      </table>
    </div>
  );
}

export default App;
